import React from "react";
import Graph from "../../components/Grafico";
import Filters from "../../components/Filtro";
import Table from "../../components/Tabela";
import Feedback from "../../components/Feedback"

const FeedbackComponent = () => {
  return (
    <div className="flex flex-col lg:flex-row p-8 gap-8 bg-backgroundcolor min-h-screen">
      <button
        className="absolute top-4 left-4 flex items-center p-2 bg-transparent text-gray-700 rounded-full hover:bg-gray-200 transition-all duration-200"
        onClick={() => navigate(-1)} // Volta para a p치gina anterior no hist칩rico
        aria-label="Voltar"
      >
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="h-5 w-5"
          viewBox="0 0 20 20"
          fill="currentColor"
        >
          <path
            fillRule="evenodd"
            d="M10 18a1 1 0 01-.707-.293l-7-7a1 1 0 010-1.414l7-7a1 1 0 011.414 1.414L4.414 10H18a1 1 0 110 2H4.414l6.293 6.293A1 1 0 0110 18z"
            clipRule="evenodd"
          />
        </svg>
      </button>
      <Graph/>

      <div className="flex-1 lg:max-w-lg bg-white shadow-md rounded-lg p-6">
        <Feedback/>
        <Filters/>
        <Table/>
      </div>
    </div>
  );
};

export default FeedbackComponent;
